    data: |
      SELECT + - col0 * - 23 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - + col2 / - col2 + + col0 / - 22 IN ( - col2, col1 * 99 );
  - name: tab1

outputs:
  - name: q4254.out
    data: |
      1173
      1955
      2093
